import React from 'react';
import './CSS/App.css';

class App extends React.Component {
  constructor (props) {
    super(props);
    this.state = {
      input: ''
    }
  }
  render() {
    return (
      <form>
        <input>
        </input>
        <button type="submit">Button</button>
      </form>
    )
  }
}

export default App;
